import React from 'react';
import logo from './logo.svg';
import './App.css';
import "./styles.css";
import { useForm } from 'react-hook-form';

export default function App() {
  const { register, handleSubmit, errors } = useForm();
  const onSubmit = data => console.log(data);
  console.log(errors);

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <input type="text" placeholder="Brand" name="Brand" ref={register({required: true, maxLength: 80})} />
      <input type="text" placeholder="Product" name="Product" ref={register({required: true, maxLength: 100})} />
      <input type="text" placeholder="Category" name="Category" ref={register({required: true, pattern: /^\S+@\S+$/i})} />

      <input type="submit" />
    </form>
  );
}
